    false,nt"url": null,nt"notes": "This annual narrative report for Fergus
    Falls Wetland Management District outlines Refuge accomplishments during the 1967
    calendar year. The report begins by summarizing the weather conditions, habitat
    conditions, water conditions, and food and cover conditions during the year. Wildlife-
    including migratory birds and upland game birds- is also covered. The Refuge development
    and maintenance section discusses physical developments, plantings, collections
    and receipts, vegetation control, and wildfires. Resource management is outlined;
    topics include grazing, haying, and fur harvesting. The public relations section
    of the report describes Refuge participation, hunting, and safety. Items of interest,
    N-R forms, and photographs are attached.",nt"license_title": "License Not
